<!doctype html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport"
          content="width=device-width, user-scalable=no, initial-scale=1.0, maximum-scale=1.0, minimum-scale=1.0">
    <meta http-equiv="X-UA-Compatible" content="ie=edge">
    <title>Welcome</title>
    <style>
        @import url('https://fonts.googleapis.com/css2?family=Baloo+Bhaijaan+2:wght@400..800&family=Lato:ital,wght@0,100;0,300;0,400;0,700;0,900;1,100;1,300;1,400;1,700;1,900&display=swap');
        @import url('https://fonts.googleapis.com/css2?family=Baloo+Bhaijaan+2:wght@400..800&family=Lato:ital,wght@0,100;0,300;0,400;0,700;0,900;1,100;1,300;1,400;1,700;1,900&family=Poppins:ital,wght@0,100;0,200;0,300;0,400;0,500;0,600;0,700;0,800;0,900;1,100;1,200;1,300;1,400;1,500;1,600;1,700;1,800;1,900&display=swap');

        body{
            font-family: 'Poppins', sans-serif;
            font-size: 16px;
            padding: 0px;
            width: 100%;
            margin: 0px;
            display: flex;
            flex-direction: column;
            overflow: hidden;
        }

        .pictures {
            position: relative;
            width: 100%;
            height: 500px; /* Высота контейнера */
        }

        .first_circle {
            position: absolute;
            top: 0;
            left: 0;
        }

        .third_circle {
            position: absolute;
            top: 0;
            left: 20%;
        }

        .person_pict {
            position: absolute;
            top: 50%;
            left: 55%;
            transform: translate(-50%, -50%);
        }

        .second_circle {
            position: absolute;
            bottom: 0;
            right: 0;
        }


        .text_bock {
            display: flex;
            flex-direction: column;
            align-items: center;
            text-align: center;
            margin: 10px 45px;
        }

        h1{
            font-family: 'Baloo Bhaijaan 2', sans-serif;
            font-size: 32px;
            font-weight: bold;
            font-style: normal;
            line-height: 120%;
            margin: 0px;
        }

        .buttons{
            display: flex;
            flex-direction: row;
            justify-content: space-between;
            margin: 35px 16px;
        }

        a {
            text-decoration: none;
            outline: none;
        }

        a:focus, a:active {
            outline: none;
            box-shadow: none;
        }

        .register {
            display: block;
            font-family: 'Poppins', sans-serif;
            font-size: 14px;
            min-width: 164px;
            height: 50px;
            border: none;
            border-radius: 92px;
            background-color: #66B498;
            color: white;
            margin: 20px auto 0px auto;
        }

        .login {
            display: block;
            font-family: 'Poppins', sans-serif;
            font-size: 14px;
            min-width: 164px;
            height: 50px;
            background-color: white;
            border-radius: 92px;
            border: 2px solid #66B498;
            color: #66B498;
            font-weight: 600;
            margin: 20px auto 0px auto;
        }

    </style>
</head>
